import React, { Component } from 'react';
import {
    View,
    Text,
    SafeAreaView,
    StyleSheet,
    TouchableOpacity,
    ScrollView,
    Image,
} from 'react-native';
import Calendar from 'react-native-whc-calendar'

const CalendarScreen = () => {
    return (
        <View style={styles.container}>
            <TouchableOpacity
                style={[styles.button, {backgroundColor: 'red'}]}
                onPress={() => {
                    const {navigate} = this.props.navigation;
                    navigate('CalendarDemo1', {choiceDate: this.choiceDate1 || null ,block: (date) => {
                            this.choiceDate1 = date;
                        }});
                }}
            >
                <Text style={styles.text}>按天数生成日期</Text>
            </TouchableOpacity>

            <TouchableOpacity
                style={[styles.button, {backgroundColor: 'gray'}]}
                onPress={() => {
                    const {navigate} = this.props.navigation;
                    navigate('CalendarDemo2', {choiceDate: this.choiceDate2 || null, choiceDate1: this.choiceDate3 || null,
                        block: (s,e) => {
                            this.choiceDate2 = s;
                            this.choiceDate3 = e;
                        }});
                }}
            >
                <Text style={styles.text}>按月数生成日期</Text>
            </TouchableOpacity>

            <TouchableOpacity
                style={[styles.button, {backgroundColor: '#13227a'}]}
                onPress={() => {
                    const {navigate} = this.props.navigation;
                    navigate('CalendarDemo3', {choiceDate: this.choiceDate4 || null, choiceDate1: this.choiceDate5 || null,
                        block: (s,e) => {
                            this.choiceDate4 = s;
                            this.choiceDate5 = e;
                        }});
                }}
            >
                <Text style={styles.text}>按年数生成日期</Text>
            </TouchableOpacity>

        </View>
    );
}
export default CalendarScreen;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        flexDirection: 'column',
        justifyContent: 'space-around',
        padding:30,
    },
    button: {
        height: 50,
        justifyContent:'center',
        alignItems:'center',
    },
    text: {
        color: '#fff',
        fontSize: 18,
    }
});
